import React from "react";
import Logo from "./assests/logo.png";
import "./App.css";
function Tiny() {
    return (
        <>
            <div className="background">
                <nav>
                    <div className="logo">
                        <img width="60px" src={Logo} alt="" />
                    </div>
                    <div className="nav_links">
                        <ul>
                            <li>Features</li>
                            <li>Developer</li>
                            <li>About</li>
                            <li>News</li>
                            <li>Resources </li>
                        </ul>
                    </div>
                    <div className="nav-btn">
                        <a>BuySycoin</a>
                        &#9654;
                    </div>
                </nav>
            </div>
        </>
    );
}
export default Tiny;
